import { hyperverge } from '../../../src/handlers/hyperverge-api.mjs'
import { common_services } from '../../../src/utility/common_services/common_services.mjs';
import sinon from 'sinon';
import { common_responses } from '../../utility/common_responses.mjs';

describe('Test hyperverge handler', () => {
  let mock;

  beforeAll(()=> {
      process.env.Stage = 'test';
      process.env.securityKey = 'By3lwX52fWLC6tWHqe1Ewy18oRlZjqVlJq9hJDzDa3Q=';
  })

  beforeEach(()=> {
    mock = sinon.mock(common_services);  
  })

  it('hyperverge - generate onboarding links', async() => {
      mock.expects("sendRequest").once().returns(mockSuccessResponse());
      
      const requestParams = {
        httpMethod: 'POST',
        operation: 'onboarding',
        queryStringParameters: null,
        body: '{"data": {"workflowId":"aadhaar_ocr_masking","transactionId": "1256789"}}',
        isMultipartRequest: false
      }
      const event = buildRestRequest(requestParams);
      const response = await hyperverge(JSON.parse(event))
    
      expect(response.statusCode).toBe(200);
      expect(response.body).toBe("{\"status\":\"success\",\"statusCode\":200,\"metadata\":{\"requestId\":\"1697173270249\"},\"result\":{\"startKycUrl\":\"https://link-kyc.idv.hyperverge.co/?identifier=6cd46785-7cfe-44e7-8342-7e3c856ef4c6_1234\"}}")
      mock.verify();
  })

  it('hyperverge - 400 bad request', async() => {
      mock.expects("sendRequest").once().returns(common_responses.badRequestResponse());
      
      const requestParams = {
        httpMethod: 'POST',
        operation: 'onboarding',
        queryStringParameters: null,
        body: '{"data": {"workflowId":"aadhaar_ocr_masking","transactionId": "1256789"}}',
        isMultipartRequest: false
      }
      const event = buildRestRequest(requestParams);
      const response = await hyperverge(JSON.parse(event))
    
      expect(response.statusCode).toBe(400);
      expect(response.body).toBe("Bad Request")
      mock.verify();
  })

  it('hyperverge - Un Authorized request', async() => {
      mock.expects("sendRequest").once().returns(common_responses.unAuthorizedResponse());      
      const requestParams = {
        httpMethod: 'POST',
        operation: 'onboarding',
        queryStringParameters: null,
        body: '{"data": {"workflowId":"aadhaar_ocr_masking","transactionId": "1256789"}}',
        isMultipartRequest: false
      }
      const event = buildRestRequest(requestParams);
      const response = await hyperverge(JSON.parse(event))
    
      expect(response.statusCode).toBe(401);
      expect(response.body).toBe('Un Authorized');
      mock.verify();
    })

  it('hyperverge - invalid operation', async() => {      
    const requestParams = {
      httpMethod: 'POST',
      operation: 'selfie',
      queryStringParameters: null,
      body: null,
      isMultipartRequest: false
    }
    const event = buildRestRequest(requestParams);
    const response = await hyperverge(JSON.parse(event))

    expect(response.statusCode).toBe(500);
    expect(response.body).toBe('{"error":"Internal Server Error","message":"The server encountered an unexpected condition."}')
    mock.verify();
  })

  it('hyperverge - ocr aadhar read operation', async() => {     
    mock.expects("sendRequest").once().returns(mockOcrResponse()); 
    const requestParams = {
      httpMethod: 'POST',
      operation: 'ocr-aadhar',
      queryStringParameters: null,
      body: '',
      isMultipartRequest: true
    }
    const event = buildRestRequest(requestParams);
    const response = await hyperverge(JSON.parse(event))
   
    expect(response.statusCode).toBe(200);
    expect(response.body).toBe('{"status":"success","statusCode":"200","result":[{"type":"pan","details":{"name":{"conf":100,"value":"Test"},"father":{"conf":99,"value":"Test"},"date":{"conf":90,"value":"28/10/1998"},"pan_no":{"conf":94,"value":"BHBGHS765"},"date_of_issue":{"conf":100,"value":"06/10/2017"},"tag":"1697185417241-d352e2bb-3a21-41ae-ac6e-3303247ee8c7-ygOFaWcauy_pan_1"}}]}')
    mock.verify();
  })

  it('hyperverge - selfie validation', async() => {
    mock.expects("sendRequest").once().returns(mockSelfieResponse());
    
    const requestParams = {
      httpMethod: 'POST',
      operation: 'selfie-validation',
      queryStringParameters: null,
      body: '',
      isMultipartRequest: true
    }
    const event = buildRestRequest(requestParams);
    const response = await hyperverge(JSON.parse(event))
  
    expect(response.statusCode).toBe(200);
    expect(response.body).toBe("{\"status\":\"success\",\"statusCode\":200,\"metadata\":{\"requestId\":\"1697177455204-30eac5be-5112-4c2f-9301-c5e14688d0c6\",\"transactionId\":\"12345\"},\"result\":{\"details\":{\"liveFace\":{\"value\":\"no\",\"confidence\":\"high\"}},\"summary\":{\"action\":\"manualReview\",\"details\":[{\"code\":\"119\",\"message\":\"Liveness failed with high confidence\"}]}}}")
    mock.verify();
  })
  
  it('hyperverge - ckyc validation request', async() => {     
    mock.expects("sendRequest").once().returns(mockCkycValidationResponse()); 
    const requestParams = {
      httpMethod: 'POST',
      operation: 'ckyc-validation',
      queryStringParameters: null,
      body: '',
      isMultipartRequest: true
    }
    const event = buildRestRequest(requestParams);
    const response = await hyperverge(JSON.parse(event))
   
    expect(response.statusCode).toBe(200);
    expect(response.body).toBe('{"status":"success","statusCode":"200","result":{"action":"approve","validPOA":["aadhaar"],"validPOI":["aadhaar"],"invalidDocs":{},"details":{"aadhaar":{"faceMatch":{"matchFound":true,"score":88},"first_name":{"matchFound":true,"score":100},"doc_template":["aadhaar_front_bottom","aadhaar_back"]}},"aadhaar_type":"STANDARD"}}')
    mock.verify();
  })

  const mockSuccessResponse = () => {
    const response = JSON.stringify({
      "status": "success",
      "statusCode": 200,
      "metadata": {
          "requestId": "1697173270249"
       },
      "result": {
          "startKycUrl": "https://link-kyc.idv.hyperverge.co/?identifier=6cd46785-7cfe-44e7-8342-7e3c856ef4c6_1234"
        }
    });
    return [
        200,
        response
    ];
  }
  
  const mockOcrResponse = () => {
    const response = JSON.stringify({
      "status": "success",
      "statusCode": "200",
      "result": [
          {
              "type": "pan",
              "details": {
                  "name": {
                      "conf": 100,
                      "value": "Test"
                  },
                  "father": {
                      "conf": 99,
                      "value": "Test"
                  },
                  "date": {
                      "conf": 90,
                      "value": "28/10/1998"
                  },
                  "pan_no": {
                      "conf": 94,
                      "value": "BHBGHS765"
                  },
                  "date_of_issue": {
                      "conf": 100,
                      "value": "06/10/2017"
                  },
                  "tag": "1697185417241-d352e2bb-3a21-41ae-ac6e-3303247ee8c7-ygOFaWcauy_pan_1"
              }
          }
      ]
  })
    return [200, response]
  }

  const mockSelfieResponse = () => {
    const response = JSON.stringify({
      "status": "success",
      "statusCode": 200,
      "metadata": {
          "requestId": "1697177455204-30eac5be-5112-4c2f-9301-c5e14688d0c6",
          "transactionId": "12345"
      },
      "result": {
          "details": {
              "liveFace": {
                  "value": "no",
                  "confidence": "high"
              }
          },
          "summary": {
              "action": "manualReview",
              "details": [
                  {
                      "code": "119",
                      "message": "Liveness failed with high confidence"
                  }
              ]
          }
      }
    });
    return [
        200,
        response
    ];
  }
  
  function buildRestRequest(requestParams) {
    const eventRequest = {
      "body": requestParams.body,
      "headers": {
        "Host": "localhost:3000",
        "transactionid": "12345"
      },
      "httpMethod": requestParams.httpMethod,
      "isBase64Encoded": false,
      "path": `/onefin/${requestParams.operation}`,
      "pathParameters": {
        "operation": requestParams.operation
      },
      "queryStringParameters": requestParams.queryStringParameters
    }
    if(requestParams.isMultipartRequest) {
      eventRequest.headers["Content-Type"] = "multipart/form-data; boundary=--------------------------880505715983312193925495";
      eventRequest['isBase64Encoded'] = true;
    }
    return JSON.stringify(eventRequest);
  }

  const mockCkycValidationResponse = () => {
    const response = JSON.stringify({
      "status": "success",
      "statusCode": "200",
      "result": {
          "action": "approve",
          "validPOA": [
              "aadhaar"
          ],
          "validPOI": [
              "aadhaar"
          ],
          "invalidDocs": {},
          "details": {
              "aadhaar": {
                  "faceMatch": {
                      "matchFound": true,
                      "score": 88
                  },
                  "first_name": {
                      "matchFound": true,
                      "score": 100
                  },
                  "doc_template": [
                      "aadhaar_front_bottom",
                      "aadhaar_back"
                  ]
              }
          },
          "aadhaar_type": "STANDARD"
      }
    })
    return [200, response]
  }
})